-- 1. подсчитать количетсво товаров по категориям
SELECT catalog.name AS `Каталог`, sections.name AS `Раздел`, categories.name AS `Категория`, COUNT(*) AS `количество`
FROM products
JOIN categories ON categories.id = products.category_id
JOIN sections ON sections.id = categories.section_id
JOIN catalog ON catalog.id = sections.catalog_id
GROUP BY `Каталог`, `Раздел`, `Категория`
ORDER BY `Каталог`, `Раздел`, `Категория`;

-- 2. вывести 5 пользователей, совершивших покупки на наибольшую сумму
SELECT c.id, c.name, SUM(o.total_price) AS `сумма всех покупок`
FROM customers c
JOIN orders o ON o.customer_id = c.id
GROUP BY c.id
ORDER BY `сумма всех покупок` DESC LIMIT 5;

-- 3. вывести 5 пользователей, купивших наибольшее количество товарных позиций
SELECT c.id, c.name, COUNT(*) AS `общее количество товарных позиций`
FROM customers c
JOIN orders o ON o.customer_id = c.id
JOIN orders_products o_p ON o_p.order_id = o.id
GROUP BY c.id
ORDER BY `общее количество товарных позиций` DESC, c.name LIMIT 5;

-- 4. вывести 7 городов, в которых наиболее часто совершалась доставка
SELECT shipments.city, COUNT(*) AS `количество доставок`
FROM shipments
JOIN orders ON orders.shipment_id = shipments.id
GROUP BY shipments.city, shipments.`status` HAVING shipments.`status` = TRUE
ORDER BY `количество доставок` DESC, shipments.city LIMIT 7;

-- 5. вывести 5 самых дорогих товаров
SELECT products.id, catalog.name AS `Каталог`, sections.name AS `Раздел`, categories.name AS `Категория`, products.name AS `Название`, products.price AS `цена`
FROM products
JOIN categories ON categories.id = products.category_id
JOIN sections ON sections.id = categories.section_id
JOIN catalog ON catalog.id = sections.catalog_id
ORDER BY catalog.name, sections.name, categories.name, products.price DESC LIMIT 5;

-- 6. вывести товары, которых нет на складе
SELECT products.id, catalog.name AS `Каталог`, sections.name AS `Раздел`, categories.name AS `Категория`, products.name AS `Название`
FROM products
JOIN categories ON categories.id = products.category_id
JOIN sections ON sections.id = categories.section_id
JOIN catalog ON catalog.id = sections.catalog_id
WHERE products.stock = 0
ORDER BY catalog.name, sections.name, categories.name;

-- 7. вывести товары, которые добавлены в закладки, и покупателей их добавивших
SELECT products.id, catalog.name AS `Каталог`, sections.name AS `Раздел`, categories.name AS `Категория`, products.name AS `Название`,
customers.name AS 'Покупатель'
FROM products
JOIN categories ON categories.id = products.category_id
JOIN sections ON sections.id = categories.section_id
JOIN catalog ON catalog.id = sections.catalog_id
JOIN wishlist ON wishlist.product_id = products.id
JOIN customers ON customers.id = wishlist.customer_id
ORDER BY customers.name, catalog.name, sections.name, categories.name;